const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexDirection: "column",
    height: "100%",
    textAlign: "justify",
    marginTop: 16,
  }
}));

const CardBody = ({
  description,
  id,
}) => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <GameDescriptionPanel description={description} />
    </div>
  );
};

export default CardBody;
